const search = (state = { visibility: "hidden", display: "none" }, action) => {
  switch (action.type) {
    case "VISIBLE":
      return {
        ...state,
        visibilty: action.payload.visibility,
        display: action.payload.display,
      };

    default:
      return state;
  }
};

export default search;
